}

class App extends component {
	constructor() {
		super()
		this.state = {
			searchfield:''
		}
	}
	render () {
	return (
		<div className='tc'>
			<h1>RoboFriends</h1>
			<SearchBox/>
			<CardList robots={robots}/>
		</div>
		)

}
}

export default App;
